import React from 'react';
import styled from 'styled-components';

const AriclesWrapper = styled.div`

`;

const ArticlesItem = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr;
`;

const ArticlesInfo = styled.div`
  display: grid;
  grid-column: span 3;
  grid-template-rows: 1fr 1fr 1fr;
`;

const ArticlesTitle = styled.span`
  color: #1890FF;

`;

const ArticlesUserInfo = styled.div`
  display: grid;
  grid-column: 4 / 5;
`;


const AriclesList = () => {

  return (
    <AriclesWrapper>
      <ArticlesItem>
        <ArticlesInfo>
          <ArticlesTitle>Some article title</ArticlesTitle>
          <ArticlesStats>
            <div className="img"></div>
            <ArticlesLikesCount></ArticlesLikesCount>
          </ArticlesStats>
          <ArticlesTagsWrap>
            <ArtclesTag>tag</ArtclesTag>
            <ArtclesTag>someTag</ArtclesTag>
          </ArticlesTagsWrap>

          <ArticlesDescription></ArticlesDescription>
        </ArticlesInfo>

        <ArticlesUserInfo>
          <ArticlesUserInfoGroup>
            <ArticlesUsername></ArticlesUsername>
            <ArticlesDate></ArticlesDate>
          </ArticlesUserInfoGroup>
          <ArticlesUserImage></ArticlesUserImage>
        </ArticlesUserInfo>
      </ArticlesItem>
    </AriclesWrapper>
  )
}

export default AriclesList;
